import * as React from 'react';
import { styled } from '@mui/material/styles';
import Paper from '@mui/material/Paper';
import Grid from '@mui/material/Grid';
import ChillImage from "../images/chilldood.svg";

const Item = styled(Paper)(({ theme }) => ({
  textAlign: 'center',
}));

function Chill() {
  // Import result is the URL of your image
  return <img src={ChillImage} alt="Dood Chills" />;
}

export default function BasicGrid() {
  return (
      <Grid container spacing={2} style={{ height:"auto", display: "flex", backgroundColor: "#384885", padding: "40px"}}>
        <Grid item xs={ 12 } md= {8}>
          <Item elevation={0} style={{backgroundColor: "#384885", color: "#ffffff",}}>
            <h1 style={{ display: "flex", justifyContent: "left", marginTop: "40px"}}> The Mission is Simple</h1>
            <h2 style={{ display: "flex", justifyContent: "left"}}> Let's Do Good</h2>
            <h3 style={{ display: "flex", justifyContent: "left"}}> 5000 Good Doods</h3>
            <h3 style={{ display: "flex", justifyContent: "left"}}> Raising Capital to execute Do Good Projects. </h3>

          </Item>
        </Grid>
        <Grid item xs={4}>
          <Item elevation={0}  style={{backgroundColor: "#384885"}}>

          <img src={ChillImage} alt="Logo"
            style={{
              maxWidth: "100%",
              minWidth: "300px",
              height: "auto",
              marginLeft: "20px",
          }}
          />

          </Item>
        </Grid>
      </Grid>
  );
}
